import { ChakraProvider, Heading, Image, extendTheme } from "@chakra-ui/react";
import { ThemeProvider, DefaultTheme } from "styled-components";
import GlobalStyles from "../components/globals";
import {
  Body,
  BodyWrapper,
  BodyWrapperDone,
  CountWrapper,
  Header,
  HeaderWrapper,
  JoinDiscord,
  JoinDiscordWrapper,
  MainHeaderWrapper,
  MainWrapper,
  SubHeading,
  SubHeadingWrapper,
} from "../components/shared";
import "./index.css";
import { useEffect, useMemo, useState } from "react";
import Head from "next/head";

const theme: DefaultTheme = {
  colors: {
    primary: "white",
    secondary: "black",
  },
};

export default function App() {
  const endDate = new Date("March 1, 2023 12:00:00 GMT-5").getTime();

  const [date, setDate] = useState(endDate - new Date().getTime());
  const [loaded, setLoaded] = useState(false);

  const [days] = useMemo(() => {
    const days = Math.floor(date / (1000 * 60 * 60 * 24));
    return [days];
  }, [date]);

  const [hours] = useMemo(() => {
    const hours = Math.floor((date % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
    return [hours];
  }, [date]);

  const [minutes] = useMemo(() => {
    const minutes = Math.floor((date % (1000 * 60 * 60)) / (1000 * 60));
    return [minutes];
  }, [date]);

  const [seconds] = useMemo(() => {
    const seconds = Math.floor((date % (1000 * 60)) / 1000);
    return [seconds];
  }, [date]);

  useEffect(() => {
    setLoaded(true);
    if (date <= 0) return;

    const interval = setInterval(() => {
      setDate(endDate - new Date().getTime());
    }, 999);
    return () => {
      clearInterval(interval);
    };
  }, []);

  if (loaded)
    return (
      <>
        <Head>
          <title>Pogy - Coming Soon</title>
        </Head>
        <ChakraProvider
          theme={extendTheme({
            colors: {
              body: {
                bg: "#07050F",
              },
            },
          })}
        >
          <ThemeProvider theme={theme}>
            <GlobalStyles />
            <Body>
              <MainWrapper>
                <MainHeaderWrapper>
                  <svg
                    width={125}
                    height={125}
                    viewBox="0 0 125 125"
                    fill="none"
                    style={{
                      boxShadow:
                        window.innerWidth > 1024
                          ? "0px 0px 36px 2px #7649F9"
                          : null,
                      borderRadius: "100%",
                      background: "#7649F9",
                    }}
                  >
                    <rect
                      width={125}
                      height={125}
                      rx="62.5"
                      fill="url(#pattern0)"
                    />
                    <defs>
                      <pattern
                        id="pattern0"
                        patternContentUnits="objectBoundingBox"
                        width={1}
                        height={1}
                      >
                        <use
                          xlinkHref="#image0_60_30"
                          transform="scale(0.000976562)"
                        />
                      </pattern>
                      <image
                        id="image0_60_30"
                        width={1024}
                        height={1024}
                        xlinkHref="data:image/png;base64,"
                      />
                    </defs>
                  </svg>

                  <HeaderWrapper>
                    <Header>
                      <Heading
                        color="white"
                        textTransform={"uppercase"}
                        fontSize={{
                          base: "4rem",
                          md: "4rem",
                          lg: "5rem",
                        }}
                        fontFamily={"Futura xblk bt"}
                        lineHeight={{
                          base: "46px",
                          md: "46px",
                          lg: "66px",
                        }}
                        textShadow={{
                          base: "none",
                          md: "none",
                          lg: "0px 0px 36px rgba(255, 255, 255, 0.5)",
                        }}
                      >
                        pogy
                      </Heading>
                    </Header>
                    <SubHeadingWrapper>
                      <SubHeading>
                        <Heading
                          color="#7649F9"
                          textTransform={"uppercase"}
                          fontSize={"40px"}
                          fontFamily={"Futura xblk bt"}
                          textShadow={{
                            base: "none",
                            md: "none",
                            lg: "0px 0px 20px rgba(118, 73, 249, 0.6)",
                          }}
                        >
                          BETA
                        </Heading>
                        <Heading
                          color="white"
                          textTransform={"uppercase"}
                          fontSize={"24px"}
                          fontFamily={"Futura xblk bt"}
                          pb={"4px"}
                        >
                          — v3.0.0
                        </Heading>
                      </SubHeading>
                    </SubHeadingWrapper>
                  </HeaderWrapper>
                </MainHeaderWrapper>
                {date <= 0 ? (
                  <>
                    <BodyWrapperDone>
                      <div
                        style={{
                          display: "flex",
                          flexDirection: "column",
                          gap: window.innerWidth > 1024 ? "3rem" : "10px",
                          alignItems: "center",
                        }}
                      >
                        <Heading
                          color="white"
                          textTransform={"uppercase"}
                          fontSize={{
                            base: "2rem",
                            md: "4rem",
                            lg: "5rem",
                          }}
                          fontFamily={"Futura xblk bt"}
                          lineHeight={{
                            base: "46px",
                            md: "46px",
                            lg: "66px",
                          }}
                        >
                          Yes, we are live!
                        </Heading>
                        <Heading
                          as="h2"
                          fontSize={{
                            base: "24px",
                            md: "30px",
                            lg: "2rem",
                          }}
                          color="white"
                        >
                          We are working hard on getting the app ready for you.
                          Keep refreshing the page.
                        </Heading>
                      </div>
                    </BodyWrapperDone>
                  </>
                ) : (
                  <BodyWrapper>
                    <CountWrapper>
                      <Heading
                        color="white"
                        textTransform={"uppercase"}
                        fontSize={{
                          base: "4rem",
                          md: "6rem",
                          lg: "9rem",
                        }}
                        fontFamily={"Futura xblk bt"}
                        lineHeight={"86px"}
                        textShadow={{
                          base: "none",
                          md: "none",
                          lg: "0px 0px 36px rgba(255, 255, 255, 0.5)",
                        }}
                      >
                        {days}
                      </Heading>
                      <Heading
                        as="h2"
                        size="xl"
                        color="white"
                        fontSize={"36px"}
                        lineHeight={{
                          base: "10px",
                          md: "30px",
                          lg: "70px",
                        }}
                      >
                        Days
                      </Heading>
                    </CountWrapper>
                    <CountWrapper>
                      <Heading
                        color="white"
                        textTransform={"uppercase"}
                        fontSize={{
                          base: "4rem",
                          md: "6rem",
                          lg: "9rem",
                        }}
                        fontFamily={"Futura xblk bt"}
                        lineHeight={"86px"}
                        textShadow={{
                          base: "none",
                          md: "none",
                          lg: "0px 0px 36px rgba(255, 255, 255, 0.5)",
                        }}
                      >
                        {hours}
                      </Heading>
                      <Heading
                        as="h2"
                        size="xl"
                        color="white"
                        fontSize={"36px"}
                        lineHeight={{
                          base: "10px",
                          md: "30px",
                          lg: "70px",
                        }}
                      >
                        Hours
                      </Heading>
                    </CountWrapper>
                    <CountWrapper>
                      <Heading
                        color="white"
                        textTransform={"uppercase"}
                        fontSize={{
                          base: "4rem",
                          md: "6rem",
                          lg: "9rem",
                        }}
                        fontFamily={"Futura xblk bt"}
                        lineHeight={"86px"}
                        textShadow={{
                          base: "none",
                          md: "none",
                          lg: "0px 0px 36px rgba(255, 255, 255, 0.5)",
                        }}
                      >
                        {minutes}
                      </Heading>
                      <Heading
                        as="h2"
                        size="xl"
                        color="white"
                        fontSize={"36px"}
                        lineHeight={{
                          base: "10px",
                          md: "30px",
                          lg: "70px",
                        }}
                      >
                        Minutes
                      </Heading>
                    </CountWrapper>
                    <CountWrapper>
                      <Heading
                        color="white"
                        textTransform={"uppercase"}
                        fontSize={{
                          base: "4rem",
                          md: "6rem",
                          lg: "9rem",
                        }}
                        fontFamily={"Futura xblk bt"}
                        lineHeight={"86px"}
                        textShadow={{
                          base: "none",
                          md: "none",
                          lg: "0px 0px 36px rgba(255, 255, 255, 0.5)",
                        }}
                      >
                        {seconds}
                      </Heading>
                      <Heading
                        as="h2"
                        size="xl"
                        color="white"
                        fontSize={"36px"}
                        lineHeight={{
                          base: "10px",
                          md: "30px",
                          lg: "70px",
                        }}
                      >
                        Seconds
                      </Heading>
                    </CountWrapper>
                  </BodyWrapper>
                )}
                <JoinDiscordWrapper>
                  <JoinDiscord
                    href="https://v3.pogy.xyz/discord"
                    target="_blank"
                    rel="noreferrer"
                  >
                    Join our Discord
                  </JoinDiscord>
                </JoinDiscordWrapper>
              </MainWrapper>
            </Body>
          </ThemeProvider>
        </ChakraProvider>
      </>
    );
  else
    return (
      <>
        <Head>
          <title>Pogy - Coming Soon</title>
        </Head>
        <ChakraProvider
          theme={extendTheme({
            colors: {
              body: {
                bg: "#07050F",
              },
            },
          })}
        ></ChakraProvider>
      </>
    );
}
